import React, { useEffect, useState } from 'react'
import { Link } from 'react-router-dom';
import Detail from './Detail';

//Este componente debera ser estilado como "dark" o "light" dependiendo del theme del Context
const Home = () => {
  const [dentistaSel, setDentistaSel] = useState({}); 
  const [cards, setCards] = useState([{}])
    const url = 'https://jsonplaceholder.typicode.com/users'
    useEffect(() => {
        fetch(url)
        .then(cards => cards.json())
        .then(data => setCards(data))
    }, [])
    console.log(cards)
    console.log(dentistaSel)

  return (
    <main className="" >
      <h1>Home</h1>
      <div className='card-grid'>
      {cards.map(card => (
        //<Link to ="/detail" key={card.id}>
        <botton onClick={()=> {setDentistaSel(card)}} >
            <div>
                <img src="./images/doctor.jpg" alt="" style={{width: 500, height: 250, objectFit: 'cover'}}/>
                <h3>{card.name}</h3>
                <h4>{card.username}</h4>
            </div>
            {dentistaSel && <Detail card={card}/>}
            </botton>
          
            //</div></Link>
        ))}
      </div>
    </main>
  )
}

export default Home
